import React from 'react';
import CardPage from "../Pages/CardPage";;
import {Route} from "react-router-dom";
import {Switch} from "react-router-dom";


class App extends React.Component {
    render() {
        return (
            <Switch>
                <Route path={'/'} component={CardPage}/>

            </Switch>
        )
    }
}

export default App;
